import React from "react";

const TodoItem = ({ todos }) => {
  return (
    <div>
      {todos.map((todo) => (
        <div key={todo.id} className="todoItem">
          <h1>{todo.message}</h1>
          <p>{todo.id}</p>
        </div>
      ))}
    </div>
  );
};

export default TodoItem;
